v turning a deaf ear to the scientists that found us some 30 years behind in addressing climate chnage in the first place; or is that being unfair to both parties? https://x.com/\",[\"^all\",\"^i\",\"^iim\",\"^io_im\",\"^io_imc8\",\"^io_lr\",\"^o\",\"^p_ag\",\"^smartlabel_personal\",\"^sq_ig_i_personal\"],null,null,null,null,\"\\u003cDB9P189MB1882D8FE42EBB40A43535D07BBBF2@DB9P189MB1882.EURP189.PROD.OUTLOOK.COM\\u003e\",null,1723023703517,null,null,null,null,null,null,null,null,null,null,null,[null,null,null,[3],[0.95127445],null,[40512611],[40512611,40510407,40510372],null,0],1723023703517,null,null,null,null,null,null,null,null,null,null,null,null,0,[null,null,0],null,null,null,null,null,null,null,null,null,null,\"1912c373ddde7213\",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,[],null,null,null,null,null,null,null,null,[[[\"Acknowledge contributions, express concern.\",\"Hi Andrew,\\n\\nThanks for the tip! I\u0027ll be sure to check out preprints in the future.\\n\\nBest regards,\\nPeter Murray-Rust\",\"Acknowledge the contributions of scientists and express concern about government inaction on climate change.\"],[\"Explain history of climate change.\",\"Dear Andrew,\\n\\nThank you for the link.\\n\\nI agree that preprints are often a great way to find research before it is published in a journal. \\n\\nBest regards,\\nPeter\",\"Provide a brief explanation of the history of climate change awareness and government inaction.\"],[\"Share personal perspective.\",\"Hi Terry,\\n\\nThanks for sharing. It\u0027s disheartening to see how resistant governments have been to the science on climate change.\\n\\nI think it\u0027s fair to say that both sides have failed to address the issue adequately. Scientists have been too slow to communicate their findings in a way that the public can understand, and governments have been too willing to ignore the evidence in favor of short-term economic interests.\\n\\nWe need to find a way to bridge this gap and get everyone on the same page. If we don\u0027t act now, the consequences will be devastating.\\n\\nBest regards,\\nPeter Murray-Rust\",\"Share a personal perspective on the relationship between scientists and government regarding climate change.\"]],\"rps-1806721302939988499\"]]],null,null,null,null,null,null,null,null,0.95127445,[[[\"Andrew Zolnai\",\"azolnai@yahoo.co.uk\"],[\"Earth Quakers\",\"earthquakers@cambridgeshire-quakers.org.uk\"],[\"Jon Fuller\",\"jon_n_fuller@hotmail.com\"],[\"Kara Laing\",\"karallaing@live.com\"],[\"Terry Jackson\",\"info@thisweekmedia.com\"],[\"Kay Hardcastle\",\"vkh@hotmail.co.uk\"]]],null,0,null,null,\"19122b8c3ee08685\"],null,\"2\",null,null,null,1,null,1723023703517],[null,\"thread-f:1806559025319574931\",\"9223370313835326191\",\"Re: java.lang.IllegalArgumentException: capacity \\u003c 0: (-2115587440 \\u003c0)\",[\"Re: java.lang.IllegalArgumentException: capacity \\u003c 0: (-2115587440 \\u003c0)\",\"Sorry for topic confusion! I tried it on 3.0.3-SNAPSHOT and indeed it worked! Thank you :) Best regards,Patrycja Zaremba\",1723019449624,\"thread-f:1806559025319574931\",[[\"msg-f:1806559025319574931\",[1,\"THausherr@t-online.de\",\"Tilman Hausherr\"],null,null,null,null,1722868943727,null,null,\"Hello Patrycja, Please try with a snapshot while I download the file: https://repository.apache.org/content/groups/snapshots/org/apache/pdfbox/pdfbox-app/3.0.3-SNAPSHOT/ Tilman PS: please create a new\",[\"^all\",\"^i\",\"^iim\",\"^io_im\",\"^io_lr\",\"^o\",\"^smartlabel_personal\",\"^sq_ig_i_personal\"],null,null,null,null,\"\\u003cCAHTLOr_6U6vVS6vF11RGE7Vx4QFun2pL0M+AatSEXaXQJW7GZg@mail.gmail.com\\u003e\",null,1722868943519,null,\"\\u003cusers.pdfbox.apache.org\\u003e\",null,null,null,null,null,null,null,null,null,[null,null,null,[1],[0.5904307],null,[40512611],[40512611,40510407,40510372],null,1],1722868943519,null,null,null,null,null,null,null,null,null,null,null,null,0,null,null,null,null,null,null,null,null,null,null,null,\"19122fd [\"msg-f:1806672044503607525\",[1,\"karallaing@live.com\",\"Kara Laing\"],null,null,null,null,1722976726921,null,null,null,[\"^all\",\"^i\",\"^iim\",\"^io_im\",\"^io_imc8\",\"^io_lr\",\"^o\",\"^p_ag\",\"^smartlabel_personal\",\"^sq_ig_i_personal\"],null,null,null,null,\"\\u003c1567030298.5487077.1722939818577@mail.yahoo.com\\u003e\",null,1722976727012,null,null,null,null,null,null,null,null,null,null,null,[null,null,null,[3],[0.8891791],null,[40512611],[40512611,40510407,40510372],null,1],1722976727012,null,null,null,null,null,null,null,null,null,null,null,null,0,[null,null,1],null,null,null,null,null,null,null,null,null,null,\"191296a6fe4428e5\",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,[],null,null,null,null,null,null,null,null,[[[\"Thank Kara for sharing thread.\",\"Dear Kara,\\n\\nThank you so much for sharing the thread from one of the authors. This is very helpful information.\\n\\nBest regards,\\nPeter Murray-Rust\",\"Write an email thanking Kara for sharing the thread.\"],[\"Share support for movement.\",\"Hello everyone,\\n\\nThank you for engaging in this important discussion. I appreciate the efforts of those who have shared resources and their support for the movement mentioned in the thread.\\n\\nLet\u0027s continue to work together to raise awareness and advocate for climate change engagement among scientists.\\n\\nBest regards,\\nPeter Murray-Rust\",\"Draft an email expressing my support for the movement mentioned in the thread.\"],[\"Inquire about library availability.\",\"Hi Andrew,\\n\\nThank you for the link to the preprint. Unfortunately, I do not have access to OSF.\\n\\nDo you know if the article will be published in a journal with library access?\\n\\nRegards,\\n\\nPeter\",\"Compose an email asking about the availability of the article in a library.\"]],\"rps-1806672044503607525\"]],[\"msg-f:1806721302939988499\",[1,\"info@thisweekmedia.com\",\"Terry Jackson\"],null,null,null,null,1723023703494,null,null,\"Hi Kara Was it not Gov turning a deaf ear to the scientists that found us some 30 years behind in addressing climate chnage in the first place; or is that being unfair to both parties? https://x.com/\",[\"^all\",\"^i\",\"^iim\",\"^io_im\",\"^io_imc8\",\"^io_lr\",\"^o\",\"^p_ag\",\"^smartlabel_personal\",\"^sq_ig_i_personal\"],null,null,null,null,\"\\u003cDB9P189MB1882D8FE42EBB40A43535D07BBBF2@DB9P189MB1882.EURP189.PROD.OUTLOOK.COM\\u003e\",null,1723023703517,null,null,null,null,null,null,null,null,null,null,null,[null,null,null,[3],[0.95127445],null,[40512611],[40512611,40510407,40510372],null,0],1723023703517,null,null,null,null,null,null,null,null,null,null,null,null,0,[null,null,0],null,null,null,null,null,null,null,null,null,null,\"1912c373ddde7213\",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,[],null,null,null,null,null,null,null,null,[[[\"Acknowledge contributions, express concern.\",\"Hi Andrew,\\n\\nThanks for the tip! I\u0027ll be sure to check out preprints in the future.\\n\\nBest regards,\\nPeter Murray-Rust\",\"Acknowledge the contributions of scientists and express concern about government inaction on climate change.\"],[\"Explain history of climate change.\",\"Dear Andrew,\\n\\nThank you for the link.\\n\\nI agree that preprints are often a great way to find research before it is published in a journal. \\n\\nBest regards,\\nPeter\",\"Provide a brief explanation of the history of climate change awareness and government inaction.\"],[\"Share personal perspective.\",\"Hi Terry,\\n\\nThanks for sharing. It\u0027s disheartening to see how resistant governments have been to the science on climate change.\\n\\nI think it\u0027s fair to say that both sides have failed to address the issue adequately. Scientists have been too slow to communicate their findings in a way that the public can understand, and governments have been too willing to ignore the evidence in favor of short-term economic interests.\\n\\nWe need to find a way to bridge this gap and get everyone on the same page. If we don\u0027t act now, the consequences will be devastating.\\n\\nBest regards,\\nPeter Murray-Rust\",\"Share a personal perspective on the relationship between scientists and government regarding climate change.\"]],\"rps-1806721302939988499\"]]],null,null,null,null,null,null,null,null,0.95127445,[[[\"Andrew Zolnai\",\"azolnai@yahoo.co.uk\"],[\"Earth Quakers\",\"earthquakers@cambridgeshire-quakers.org.uk\"],[\"Jon Fuller\",\"jon_n_fuller@hotmail.com\"],[\"Kara Laing\",\"karallaing@live.com\"],[\"Terry Jackson\",\"info@thisweekmedia.com\"],[\"Kay Hardcastle\",\"vkh@hotmail.co.uk\"]]],null,0,null,null,\"19122b8c3ee08685\"],null,\"2\",null,null,null,1,null,1722928632165],[null,\"thread-f:1806619903475525413\",\"9223370313927774355\",\"What Makes a Password Strong: Why What Youve Been Told Is Wrong | dylan hudson in CodeX\",[\"What Makes a Password Strong: Why What Youve Been Told Is Wrong | dylan hudson in CodeX\",\"Peter Murray-Rust Stories for Peter Murray-Rust @peter.murray.rustBecome a member Medium daily digest Today\u0027s highlights CodeX dylan hudson in CodeX 8 min read What Makes a Password Strong: Why\",1722927001439,\"thread-f:1806619903475525413\",[[\"msg-f:1806619903475525413\",[1,\"noreply@medium.com\",\"Medium Daily Digest\"],null,null,null,null,1722927001439,null,null,\"Peter Murray-Rust Stories for Peter Murray-Rust @peter.murray.rustBecome a member Medium daily digest Today\u0027s highlights CodeX dylan hudson in CodeX 8 min read What Makes a Password Strong: Why\",[\"^all\",\"^i\",\"^io_unim\",\"^oc_unsub\",\"^smartlabel_notification\",\"^sub_m\",\"^u\",\"^unsub\"],null,null,null,null,null,null,1722927001452,null,null,null,null,null,null,null,null,null,null,null,[null,null,null,[1],[0.046096094],null,[40512611],[40512611,40510407,40510372],null,1],1722927001452,null,null,null,null,null,null,null,null,null,null,null,null,0,[null,null,1,null,\"noreply@medium.com\"],null,null,null,null,null,null,nul ll,null,null,null,null,[[[\\\"Explain importance of preprints.\\\",\\\"Hi Andrew,\\\\n\\\\nThank you for letting me know about the Yahoo Mail article. It\u0027s a great resource for finding information on a variety of topics.\\\\n\\\\nI also appreciate you sharing the information about preprints. I\u0027m not familiar with them, so I\u0027ll be sure to check them out.\\\\n\\\\nThanks again for your help.\\\\n\\\\nSincerely,\\\\nPeter Murray-Rust\\\",\\\"Explain why preprints are important.\\\"],[\\\"Suggest alternative email search tool.\\\",\\\"Hi Andrew,\\\\n\\\\nThank you for the suggestion. I\u0027ll look into the preprint at the OSF link you provided.\\\\n\\\\nI appreciate your help and support.\\\\n\\\\nBest regards,\\\\nPeter\\\",\\\"Suggest an alternative to Yahoo Mail for searching and organizing emails.\\\"],[\\\"Summarize article and explain significance.\\\",\\\"Dear Andrew,\\\\n\\\\nThank you for the update. I appreciate you letting me know that the group you tried to contact may not exist.\\\\n\\\\nWould you happen to have any suggestions on where else I might be able to find this information? I am interested in learning more about the climate change engagement of scientists.\\\\n\\\\nThank you again for your assistance.\\\\n\\\\nBest regards,\\\\nPeter Murray-Rust\\\",\\\"Provide a summary of the article and explain its significance.\\\"]],\\\"rps-1806633352335942229\\\"]],[\\\"msg-f:1806672044503607525\\\",[1,\\\"karallaing@live.com\\\",\\\"Kara Laing\\\"],1722976726921,[\\\"^all\\\",\\\"^i\\\",\\\"^iim\\\",\\\"^io_im\\\",\\\"^io_imc8\\\",\\\"^io_lr\\\",\\\"^o\\\",\\\"^p_ag\\\",\\\"^smartlabel_personal\\\",\\\"^sq_ig_i_personal\\\"],null,null,1722976727012,null,null,null,null,\\\"\\\\u003c1567030298.5487077.1722939818577@mail.yahoo.com\\\\u003e\\\",null,null,[null,null,null,[3],[0.8891791],null,[40512611],[40512611,40510407,40510372],null,1],1722976727012,null,null,null,null,null,0,null,[null,null,1],null,null,null,\\\"191296a6fe4428e5\\\",null,null,null,null,null,null,null,null,null,null,[],null,null,null,null,null,null,null,null,null,[[[\\\"Thank Kara for sharing thread.\\\",\\\"Dear Kara,\\\\n\\\\nThank you so much for sharing the thread from one of the authors. This is very helpful information.\\\\n\\\\nBest regards,\\\\nPeter Murray-Rust\\\",\\\"Write an email thanking Kara for sharing the thread.\\\"],[\\\"Share support for movement.\\\",\\\"Hello everyone,\\\\n\\\\nThank you for engaging in this important discussion. I appreciate the efforts of those who have shared resources and their support for the movement mentioned in the thread.\\\\n\\\\nLet\u0027s continue to work together to raise awareness and advocate for climate change engagement among scientists.\\\\n\\\\nBest regards,\\\\nPeter Murray-Rust\\\",\\\"Draft an email expressing my support for the movement mentioned in the thread.\\\"],[\\\"Inquire about library availability.\\\",\\\"Hi Andrew,\\\\n\\\\nThank you for the link to the preprint. Unfortunately, I do not have access to OSF.\\\\n\\\\nDo you know if the article will be published in a journal with library access?\\\\n\\\\nRegards,\\\\n\\\\nPeter\\\",\\\"Compose an email asking about the availability of the article in a library.\\\"]],\\\"rps-1806672044503607525\\\"]],[\\\"msg-f:1806721302939988499\\\",[1,\\\"info@thisweekmedia.com\\\",\\\"Terry Jackson\\\"],1723023703494,[\\\"^all\\\",\\\"^i\\\",\\\"^iim\\\",\\\"^io_im\\\",\\\"^io_imc8\\\",\\\"^io_lr\\\",\\\"^o\\\",\\\"^p_ag\\\",\\\"^smartlabel_personal\\\",\\\"^sq_ig_i_personal\\\"],null,null,1723023703517,null,null,null,\\\"Hi Kara Was it not Gov turning a deaf ear to the scientists that found us some 30 years behind in addressing climate chnage in the first place; or is that being unfair to both parties? https://x.com/\\\",\\\"\\\\u003cDB9P189MB1882D8FE42EBB40A43535D07BBBF2@DB9P189MB1882.EURP189.PROD.OUTLOOK.COM\\\\u003e\\\",null,null,[null,null,null,[3],[0.95127445],null,[40512611],[40512611,40510407,40510372],null,0],1723023703517,null,null,null,null,null,0,null,[null,null,0],null,null,null,\\\"1912c373ddde7213\\\",null,null,null,null,null,null,null,null,null,null,[],null,null,null,null,null,null,null,null,null,[[[\\\"Acknowledge contributions, express concern.\\\",\\\"Hi Andrew,\\\\n\\\\nThanks for the tip! I\u0027ll be sure to check out preprints in the future.\\\\n\\\\nBest regards,\\\\nPeter Murray-Rust\\\",\\\"Acknowledge the contributions of scientists and express concern about government inaction on climate change.\\\"],[\\\"Explain history of climate change.\\\",\\\"Dear Andrew,\\\\n\\\\nThank you for the link.\\\\n\\\\nI agree that preprints are often a great way to find research before it is published in a journal. \\\\n\\\\nBest regards,\\\\nPeter\\\",\\\"Provide a brief explanation of the history of climate change awareness and government inaction.\\\"],[\\\"Share personal perspective.\\\",\\\"Hi Terry,\\\\n\\\\nThanks for sharing. It\u0027s disheartening to see how resistant governments have been to the science on climate change.\\\\n\\\\nI think it\u0027s fair to say that both sides have failed to address the issue adequately. Scientists have been too slow to communicate their findings in a way that the public can understand, and governments have been too willing to ignore the evidence in favor of short-term economic interests.\\\\n\\\\nWe need to find a way to bridge this gap and get everyone on the same page. If we don\u0027t act now, the consequences will be devastating.\\\\n\\\\nBest regards,\\\\nPeter Murray-Rust\\\",\\\"Share a personal perspective on the relationship between scientists and government regarding climate change.\\\"]],\\\"rps-1806721302939988499\\\"]]]]\",\"f\":false,\"g\":2,\"h\":\"41515224\",\"i\":\"1806554281879307909\"},{\"a\":11,\"b\":\"thread-f:1806559025319574931\",\"d\":\"[[\\\"thread-f:1806559025319574931\\\",\\\"Re: java.lang.IllegalArgumentException: capacity \\\\u003c 0: (-2115587440 \\\\u003c0)\\\",\\\"Sorry for topic confusion! I tried it on 3.0.
